import '../../css/test.css';
import { Navbar, Nav } from 'react-bootstrap';

const Test = () => {

    return (
        <div>
            <section id="navbar">
                <Navbar bg="light">
                    <Navbar.Brand href="#home">AbdulM95</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                            <Nav className="mr-auto">
                                <Nav.Link class="link" href="#home">Home</Nav.Link>
                                <Nav.Link class="link" href="resume.html">Resume/CV</Nav.Link>
                                <Nav.Link class="link" href="about.html">About</Nav.Link>
                                <Nav.Link class="link" href="skills.html">Skills</Nav.Link>
                                <Nav.Link class="link" href="leisure.html">Leisure</Nav.Link>
                            </Nav>
                </Navbar>
            </section>
        </div>
    )
}

export default Test;
